import React from 'react'

const SettingPanel = () => {
  return (
    <div style={{ textAlign: 'left', }}>
        <label>Work minutes:</label>
        <input type="number" name="pomodoro" id="pomodoro" min="5" max="90"></input>
        <label>Break minutes:</label>
        <input type="number" name="shortBreak" id="short-break" min="1" max="30"></input>
    </div>
  )
}

export default SettingPanel
